		static Particle ClosestParticleLongTerm(List<Particle> particles)
		{
			var minAcceleration = particles.Min(p => p.Acceleration.Length);
			particles = particles.Where(p => p.Acceleration.Length == minAcceleration).ToList();

			while (true)
			{
				bool noneMovesToOrigin = particles.All(p => (p.Position + p.Velocity).Length > p.Position.Length);
				bool allSameDirection = particles.All(p =>
				{
					// NOTE(jpg): test if direction of velocity matches acceleration
					var v = p.Velocity;
					var a = p.Acceleration;
					return (a.X == 0 || Math.Sign(a.X) == Math.Sign(v.X))
						&& (a.Y == 0 || Math.Sign(a.Y) == Math.Sign(v.Y))
						&& (a.Z == 0 || Math.Sign(a.Z) == Math.Sign(v.Z));
				});

				if (noneMovesToOrigin && allSameDirection)
				{
					break;
				}

				for (int i = 0; i < particles.Count; i++)
				{
					particles[i] = particles[i].SimStep();
				}
			}

			return particles.MinBy(p => p.Position.Length);
		}

		static int ParticleLongTermWithoutCollision(List<Particle> particles, int simCount)
		{
			for (int i = 0; i < simCount; i++)
			{
				particles = particles
		
					// NOTE(jpg): remove collisions
					.GroupBy(p => p.Position)
					.Where(g => g.Count() == 1)
					.SelectMany(g => g)
					
					// NOTE(jpg): sim
					.Select(p => p.SimStep())
					
					.ToList();
			}

			return particles.Count;
		}

		static List<Particle> ParseInput(string input)
		{
			Vector3 ParseVector3(string s, int startIndex)
			{
				var endIndex = s.IndexOf('>', startIndex);
				var values = s.Substring(startIndex, endIndex - startIndex)
					.Split(',')
					.Select(int.Parse)
					.ToList();

				return new Vector3() { X = values[0], Y = values[1], Z = values[2] };
			}

			return input.Split(new char[] { '\r', '\n' }, StringSplitOptions.RemoveEmptyEntries)
				.Select((line, index) => new Particle()
				{
					Id = index,
					Position = ParseVector3(line, line.IndexOf("p=<", InvariantCulture) + 3),
					Velocity = ParseVector3(line, line.IndexOf("v=<", InvariantCulture) + 3),
					Acceleration = ParseVector3(line, line.IndexOf("a=<", InvariantCulture) + 3),
				}).ToList();
		}

		struct Vector3
		{
			public long X, Y, Z;

			public long Length
				=> Math.Abs(X) + Math.Abs(Y) + Math.Abs(Z);

			public static Vector3 operator +(Vector3 lhs, Vector3 rhs) => new Vector3()
			{
				X = checked(lhs.X + rhs.X),
				Y = checked(lhs.Y + rhs.Y),
				Z = checked(lhs.Z + rhs.Z),
			};

			public override string ToString()
			{
				return $"({nameof(X)}: {X}, {nameof(Y)}: {Y}, {nameof(Z)}: {Z})";
			}

			public override bool Equals(object obj)
			{
				if (!(obj is Vector3))
				{
					return false;
				}

				var vector = (Vector3)obj;
				return X == vector.X &&
					   Y == vector.Y &&
					   Z == vector.Z;
			}

			public override int GetHashCode()
			{
				var hashCode = -307843816;
				hashCode = hashCode * -1521134295 + base.GetHashCode();
				hashCode = hashCode * -1521134295 + X.GetHashCode();
				hashCode = hashCode * -1521134295 + Y.GetHashCode();
				hashCode = hashCode * -1521134295 + Z.GetHashCode();
				return hashCode;
			}
		}

		struct Particle
		{
			public int Id { get; set; }
			public Vector3 Position { get; set; }
			public Vector3 Velocity { get; set; }
			public Vector3 Acceleration { get; set; }

			public Particle SimStep()
			{
				var p = this;
				p.Velocity += p.Acceleration;
				p.Position += p.Velocity;
				return p;
			}

			public override string ToString()
			{
				return $"{nameof(Id)}: {Id}, {nameof(Position)}: {Position}, {nameof(Velocity)}: {Velocity}, {nameof(Acceleration)}: {Acceleration}";
			}
		}
	}
